export default function coursetest() {
  let cartItem={
    "cartItem":
    [
        {
            "id":5,
            "name":"blue berry",
            "inage":"blueberry.jpg",
            "price":10,
            "description":"blue berry description",
            "quantity":3
        },
        {
            "id":4,
            "name":"watermelon",
            "inage":"watermelon.jpg",
            "price":20,
            "description":"watermelon description",
            "quantity":5
        }
    ]
  }
  let {cartItems} = carItem
  let cartEmpty = carItems.length <= 0 ? true : false

  return (
    <div>
    {
        !cartEmpty &&
        <div>
            <div id="carSection">
                Part one 
            </div>
            <div id="checOutSection">
                Part two
            </div>
        </div>
    }
    </div>
  )
}
